import React from "react";
import ReactDOM from "react-dom";
import App from "./Pages/router/index";

import "@fontsource/lato/400.css"; // Weight 400.
import "@fontsource/lato/400-italic.css"; // Weight 400 italic.
import "@fontsource/lato/700.css"; // Weight 700.
import "@fontsource/lato/700-italic.css"; // Weight 700 italic.

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
